import axios from 'axios';
import { useState, useEffect } from 'react';
import './App.css';

function App() {

  const [aatrox, setAatrox] = useState();

  useEffect(() => {
    axios.get('http://ddragon.leagueoflegends.com/cdn/13.5.1/data/en_US/champion.json')
    .then(res => {
      setAatrox();
    })
  })

  return (
    <div className="App">
      <h1>Wow this is cool!</h1>
    </div>
  );
}

export default App;
